import React from 'react';
import Diff from 'react-diff-view';
import 'react-diff-view/style/index.css';

const DiffWithSourceExpansion = withSourceExpansion(Diff);

const OldCode = `
// This is the old code
function add(a, b) {
  return a + b;
}
`;

const NewCode = `
// This is the new code
function add(a, b) {
  return a + b + 1; // Added 1 to the result
}
`;


const CodeDifferentiator = ({ oldCode, newCode }) => {
  const diffString = Diff.createPatch('oldCode', 'newCode', oldCode, newCode);

  return <Diff diffType="chars" hunks={diffString} />;
};



function App() {
  return (
    <div className="App">
      <h1>Code Diff Example</h1>
      <CodeDifferentiator />
    </div>
  );
}

export default App;
